CREATE DEFINER=`root`@`localhost` PROCEDURE `akomodasiList` (IN `id_pendaftaran` INT(11))  NO SQL
BEGIN
    SELECT item, total from (
                                SELECT concat(bg.nama , ' kelas ', k.nama) as item, IFNULL(SUM(ri.total_hari * ri.nominal), 0) as total
                                FROM dc_rawat_inap ri
                                         JOIN dc_bed bed on (ri.id_bed = bed.id)
                                         JOIN dc_ruang ruang on (ruang.id = bed.id_ruang)
                                         JOIN dc_kelas k on (ruang.id_kelas = k.id)
                                         JOIN dc_bangsal bg on (ri.id_bangsal = bg.id)
                                         JOIN dc_layanan_pendaftaran lp ON (lp.id = ri.id_layanan_pendaftaran)
                                         JOIN dc_kelas kl ON (ri.id_kelas = kl.id)
                                WHERE lp.id_pendaftaran = id_pendaftaran
                                  AND kl.nama NOT IN ('ICU', 'NICU')
                                UNION ALL select concat(kmo.nama) as item, IFNULL(sum(jko.harga_kamar), 0) as total
                                from dc_jadwal_kamar_operasi jko
                                         join dc_kamar_operasi kmo on (jko.id_kamar_operasi = kmo.id)
                                         JOIN dc_layanan_pendaftaran lp ON (lp.id = jko.id_layanan_pendaftaran)
                                where lp.id_pendaftaran = id_pendaftaran
                                group by jko.no_registrasi
                                having sum(jko.harga_kamar) is not NULL
                                UNION ALL SELECT concat(l.nama) as item, IFNULL(SUM(tk.total * tk.qty), 0) as total
                                FROM dc_tarif_tindakan tk
                                         JOIN dc_komponen_tarif kt ON (kt.id = tk.id_komponen_tarif)
                                         JOIN dc_layanan l on (l.id = kt.id_layanan)
                                         JOIN dc_layanan_pendaftaran lp ON (lp.id = tk.id_layanan_pendaftaran)
                                WHERE lp.id_pendaftaran = id_pendaftaran
                                  AND kt.id_layanan in (SELECT layanan_id FROM conf_billcbg WHERE item = 'adm')
                                GROUP BY l.id
                            ) as q HAVING total > 0;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `alkesList` (IN `id_pendaftaran` INT(11))  NO SQL
BEGIN

    SELECT  concat(bg.nama, ' ', bg.kekuatan, ' ', stn.nama, ' ', sd.nama) as item, pjd.qty, SUM((pjd.harga_jual) * pjd.qty) as total
    FROM dc_detail_penjualan pjd
             JOIN dc_penjualan p ON (pjd.id_penjualan = p.id)
             JOIN dc_kemasan_barang kb ON (kb.id = pjd.id_kemasan)
             JOIN dc_barang bg on (bg.id = kb.id_barang)
             JOIN dc_sediaan sd on (bg.id_sediaan = sd.id)
             JOIN dc_satuan stn on (bg.satuan_kekuatan = stn.id)
             JOIN dc_layanan_pendaftaran lp ON (lp.id = p.id_layanan_pendaftaran)
    WHERE bg.id_kategori = '2'
      AND p.id_resep IS NOT NULL
      AND lp.id_pendaftaran = id_pendaftaran
      AND p.id_kemoterapi IS NULL
    GROUP BY bg.id
    HAVING pjd.qty > 0
    UNION ALL SELECT concat(bg.nama, ' ', bg.kekuatan, ' ', stn.nama, ' ', sd.nama) as item, pjd.qty, SUM((pjd.harga_jual) * pjd.qty) as total
    FROM dc_detail_penjualan pjd
             JOIN dc_penjualan p ON (pjd.id_penjualan = p.id)
             JOIN dc_kemasan_barang kb ON (kb.id = pjd.id_kemasan)
             JOIN dc_barang bg on (bg.id = kb.id_barang)
             JOIN dc_sediaan sd on (bg.id_sediaan = sd.id)
             JOIN dc_satuan stn on (bg.satuan_kekuatan = stn.id)
             JOIN dc_layanan_pendaftaran lp ON (lp.id = p.id_layanan_pendaftaran)
    WHERE bg.id_kategori = '2'
      AND p.id_resep IS NULL
      AND p.id_operasi IS NULL
      AND lp.id_pendaftaran = id_pendaftaran
      AND p.id_kemoterapi IS NULL
    GROUP BY bg.id
    HAVING pjd.qty > 0
    UNION ALL SELECT concat(bg.nama, ' ', bg.kekuatan, ' ', stn.nama, ' ', sd.nama) as item, pjd.qty, IFNULL(SUM((pjd.harga_jual) * pjd.qty), 0) as total
    FROM dc_detail_penjualan pjd
             JOIN dc_penjualan pn ON (pn.id = pjd.id_penjualan)
             JOIN dc_jadwal_kamar_operasi ko ON (ko.no_registrasi = pn.id_operasi)
             JOIN dc_layanan_pendaftaran lp ON (lp.id = ko.id_layanan_pendaftaran)
             JOIN dc_kemasan_barang kb ON (kb.id = pjd.id_kemasan)
             JOIN dc_barang bg on (bg.id = kb.id_barang)
             JOIN dc_sediaan sd on (bg.id_sediaan = sd.id)
             JOIN dc_satuan stn on (bg.satuan_kekuatan = stn.id)
    WHERE lp.id_pendaftaran = id_pendaftaran
      AND bg.id_kategori = '2'
    GROUP BY bg.id;

END$$

