CREATE DEFINER=`root`@`localhost` PROCEDURE `completeLastService` (IN `visitation_id` INT(11))  NO SQL
BEGIN
	SELECT IFNULL(sp.nama, '') AS clinic, lp.jenis AS service,
	IFNULL(pg.nama, '') AS doctor   
	FROM dc_layanan_pendaftaran lp 
	LEFT JOIN dc_spesialisasi sp ON (sp.id = lp.id_unit_layanan) 
	LEFT JOIN dc_nakes n ON (n.id = lp.id_dokter) 
	LEFT JOIN dc_pegawai pg ON (pg.id = n.id_pegawai) 
	WHERE lp.id_pendaftaran = visitation_id
	ORDER BY lp.waktu DESC 
	LIMIT 0, 1;

END$$

CREATE DEFINER=`remote`@`%` PROCEDURE `fg_booking_klinik` (IN `pk_poliklinik` BIGINT(20), IN `pk_pegawai` BIGINT(20), IN `pk_peg_pengganti` BIGINT(20), IN `pk_pasien` BIGINT(20), IN `tgl_daftar` DATE, IN `pk_asuransi` BIGINT(20), IN `no_asuransi` VARCHAR(30), IN `no_rujukan` VARCHAR(30), IN `tgl_rujukan` DATE, IN `pasien_baru` INT(1), IN `waktu_simpan` DATETIME)  BEGIN

DECLARE pk_pegawai_users bigint(20);
DECLARE pk_nakes bigint(20);
DECLARE pk_pendaftaran bigint(20);
DECLARE pk_layanan_pendaftaran bigint(20);
DECLARE cara_bayar varchar(20);
DECLARE next_antri bigint(20);
DECLARE status_pasien varchar(20);

START TRANSACTION;

SELECT IF(COUNT(*) = 0, 'Baru', 'Lama') INTO status_pasien FROM `dc_pendaftaran` WHERE `id_pasien` = pk_pasien;

SELECT IFNULL(`dc_pegawai`.`id`, NULL) INTO pk_pegawai_users FROM `dc_pegawai` JOIN `dc_users` ON (`dc_users`.`id` = `dc_pegawai`.`id`) WHERE `dc_users`.`username` = 'regonline';


SET pk_pendaftaran = LAST_INSERT_ID();


SELECT IFNULL(`id`, NULL) INTO pk_nakes FROM `dc_nakes` WHERE `id_pegawai` = pk_pegawai;

IF pk_asuransi IS NULL THEN
	SET cara_bayar = 'Tunai';
ELSE
	SET cara_bayar = 'Asuransi';
END IF;

SELECT MAX(no_antri_poli) INTO next_antri FROM `antrian`.`dc_antrian` WHERE `tanggal` = tgl_daftar AND `id_poliklinik` = pk_poliklinik 
ORDER BY `no_antri_poli` DESC LIMIT 1;

IF next_antri > 0 THEN
	SET next_antri = next_antri + 1;
ELSE
	SET next_antri = 1;
END IF;



SET pk_layanan_pendaftaran = LAST_INSERT_ID();

UPDATE `resume_kunjungan` SET `id_layanan_pendaftaran` = pk_layanan_pendaftaran WHERE `id` = pk_pendaftaran;

COMMIT;

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `keperawatanList` (IN `id_pendaftaran` INT(11))  NO SQL
BEGIN

    SELECT concat(l.nama) as item, IFNULL(sum(tk.total * tk.qty), 0) as total
    FROM dc_tarif_tindakan tk
             JOIN dc_komponen_tarif kt on (kt.id = tk.id_komponen_tarif)
             JOIN dc_layanan l on (l.id = kt.id_layanan)
             JOIN dc_layanan_pendaftaran lp on (lp.id = tk.id_layanan_pendaftaran)
    WHERE lp.id_pendaftaran = id_pendaftaran
      and tk.jenis != 'Akomodasi Ranap'
      AND kt.id_layanan NOT IN (SELECT layanan_id FROM conf_billcbg WHERE item IN ('sewa', 'adm', 'bank_darah', 'penunjang', 'konsultasi', 'tenaga_ahli', 'non_bedah'))
    GROUP BY l.id;

END$$

