CREATE DEFINER=`root`@`localhost` PROCEDURE `patientVisitationList` (IN `medical_record_number` VARCHAR(300))  NO SQL
BEGIN

	SELECT pd.id, pd.no_register, pd.waktu_daftar, 
	concat_ws('', pd.id_pasien) as id_pasien, 
	p.nama, '' AS inpatient_room, '' AS insurance, 
	IFNULL(p.id, '') as patient_id, 
	IFNULL(p.nama, '') as patient_name, 
	IFNULL(p.kelamin, '') as gender, 
	if(p.tanggal_lahir != '0000-00-00' ,IFNULL(p.tanggal_lahir, now()), now()) as date_birth, 
	IFNULL(p.alamat, '') as address 
	FROM dc_pendaftaran pd 
	JOIN dc_pasien p on (p.id = pd.id_pasien) 
	WHERE pd.id_pasien = medical_record_number
	ORDER BY pd.waktu_daftar DESC; 
    
END$$

