    WHERE lp.id_pendaftaran = id_pendaftaran
    GROUP BY l.id HAVING total > 0;


END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `prosedurBedahList` (IN `id_pendaftaran` INT(11))  NO SQL
BEGIN


