CREATE DEFINER=`root`@`localhost` PROCEDURE `visitation` (IN `service` VARCHAR(30), IN `reg_number` VARCHAR(30))  NO SQL
BEGIN
	SET @sl1 = "SELECT pd.id, pd.no_register, pd.waktu_daftar, 
			concat_ws('', pd.id_pasien) AS id_pasien, 
			p.nama, IF(lp.id_penjamin is null, 'Umum', pj.nama) AS insurance, 
			IFNULL(p.id, '') as patient_id, 
			IFNULL(p.nama, '') as patient_name, 
			IFNULL(p.kelamin, '') as gender, 
			if(p.tanggal_lahir != '0000-00-00' ,IFNULL(p.tanggal_lahir, now()), now()) as date_birth, 
			IFNULL(p.alamat, '') as address, ";
    
   	IF service = 'Rawat Inap' THEN
   		SET @sl2 = 	" concat_ws(', ', bg.nama, concat('Kelas ', ri.kelas), concat('Ruang ', ri.no_ruang) ) AS inpatient_room  ";
    	SET @sql = "FROM dc_rawat_inap ri 
					JOIN dc_layanan_pendaftaran lp ON (lp.id = ri.id_layanan_pendaftaran) 
					JOIN dc_pendaftaran pd ON (pd.id = lp.id_pendaftaran) 
					JOIN dc_pasien p ON (p.id = pd.id_pasien) 
					JOIN dc_bangsal bg on (bg.id = ri.id_bangsal) 
					LEFT JOIN dc_penjamin pj ON (pj.id = lp.id_penjamin) 
					WHERE ri.keluar is null ";	
   	ELSE
    	SET @sl2 = 	" '' AS inpatient_room  ";
    	SET @sql = "FROM dc_pendaftaran pd 
					JOIN dc_pasien p on (p.id = pd.id_pasien) 
					JOIN dc_layanan_pendaftaran lp ON (pd.id = lp.id_pendaftaran) 
					LEFT JOIN dc_penjamin pj ON (pj.id = lp.id_penjamin) 
                    WHERE pd.rawat = 'Jalan' ";	
   
   	END IF;
    
    SET @select = CONCAT(@sl1, @sl2);
    
    SET @grup = " GROUP BY pd.id ";
    
    SET @filter = CONCAT(" AND pd.no_register = ", "'", reg_number, "'");
    
    SET @query = CONCAT(@select, @sql, @filter, @grup);	
    
	PREPARE stmt FROM @query;
	EXECUTE stmt;
	DEALLOCATE PREPARE stmt;


END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `visitationList` (IN `page` INT(5), IN `limiter` INT(3), IN `service` VARCHAR(30), IN `visit_date` VARCHAR(10), IN `clinic` VARCHAR(11), IN `inpatient_room` VARCHAR(11), IN `medical_record_number` VARCHAR(30), IN `reg_number` VARCHAR(30), IN `patient_name` VARCHAR(255), IN `doctor` VARCHAR(11), IN `insurance` VARCHAR(11), IN `keyword` VARCHAR(255), IN `querymode` VARCHAR(30))  NO SQL
BEGIN

DECLARE q TEXT;

SET @count = "SELECT COUNT(pd.id) AS total ";

SET @sl1 = "SELECT pd.id, pd.no_register, pd.waktu_daftar, 
	concat_ws('', pd.id_pasien) AS id_pasien, 
	p.nama, IF(lp.id_penjamin is null, 'Umum', pj.nama) AS insurance, 
	IFNULL(p.id, '') as patient_id, 
	IFNULL(p.nama, '') as patient_name, 
	IFNULL(p.kelamin, '') as gender, 
	if(p.tanggal_lahir != '0000-00-00' ,IFNULL(p.tanggal_lahir, now()), now()) as date_birth, 
	IFNULL(p.alamat, '') as address, ";
    
IF service = 'Rawat Inap' THEN
	SET @sl2 = 	" concat_ws(', ', bg.nama, concat('Kelas ', kl.nama), concat('Ruang ', ri.no_ruang) ) AS inpatient_room  ";
    SET @sql = "FROM dc_rawat_inap ri 
						JOIN dc_layanan_pendaftaran lp ON (lp.id = ri.id_layanan_pendaftaran) 
						JOIN dc_pendaftaran pd ON (pd.id = lp.id_pendaftaran) 
						JOIN dc_pasien p ON (p.id = pd.id_pasien) 
						JOIN dc_bangsal bg on (bg.id = ri.id_bangsal) 
						JOIN dc_kelas kl ON (kl.id = ri.id_kelas) 
						LEFT JOIN dc_penjamin pj ON (pj.id = lp.id_penjamin) 
						WHERE ri.keluar IS NULL 
						AND pd.status != 'Batal'";
ELSE 
	SET @sl2 = 	" '' AS inpatient_room ";
	SET @sql_rajal = "FROM dc_pendaftaran pd 
					JOIN dc_pasien p on (p.id = pd.id_pasien) 
					JOIN dc_layanan_pendaftaran lp ON (pd.id = lp.id_pendaftaran) 
					LEFT JOIN dc_penjamin pj ON (pj.id = lp.id_penjamin)";

	SET @wh1 = CONCAT("WHERE lp.jenis = '", service, "'");
	SET @wh2 = " AND pd.status != 'Batal'";
	SET @wh3 = CONCAT("AND pd.waktu_daftar BETWEEN '", visit_date, " 00:00:00'", " AND '", visit_date, " 23:59:59'");  
	SET @sql = CONCAT(@sql_rajal, @wh1, @wh2, @wh3);
END IF;

SET @select = CONCAT(@sl1, @sl2);
    
SET q = "";

IF keyword != '' THEN
	SET q = CONCAT(q, " AND (p.nama like '%", keyword, "%' OR  p.id like '%", keyword, "') ");
END IF;

IF patient_name != '' THEN
	SET q = CONCAT(q, " AND p.nama like '%", patient_name, "%' ");
END IF;

IF clinic != '' THEN
	SET q = CONCAT(q, " AND lp.id_unit_layanan = '", clinic, "' ");
END IF;

IF (service = 'Rawat Inap' && inpatient_room != '') THEN
	SET q = CONCAT(q, " AND ri.id_bangsal = '", inpatient_room, "' ");
END IF;

IF medical_record_number != '' THEN
	SET q = CONCAT(q, " AND p.id like '%", medical_record_number, "' ");
END IF;    
    
IF reg_number != '' THEN
	SET q = CONCAT(q, " AND pd.no_register = '", reg_number, "' ");
END IF;

IF doctor != '' THEN
	SET q = CONCAT(q, " AND lp.id_dokter = '", doctor, "' ");
END IF;

IF insurance != '' THEN
	SET q = CONCAT(q, " AND lp.id_penjamin = '", insurance, "' ");
END IF;
 
    



SET @filter = q;
SET @grup = " GROUP BY pd.id ";

IF page > 0 THEN 
	SET @limitation = CONCAT("LIMIT ", startPage(page, limiter), " ,", limiter);
ELSE
	SET @limitation = "";
END IF;

IF querymode = 'list' THEN
	SET @query = CONCAT(@select, @sql, @filter, @grup, @limitation);
ELSE
	SET @query = CONCAT("SELECT COUNT(*) AS jml FROM (", @count, @sql, @filter, @grup, ") AS q");
END IF;
					  


PREPARE stmt FROM @query;
EXECUTE stmt;
DEALLOCATE PREPARE stmt;

END$$

