CREATE DEFINER=`root`@`localhost` FUNCTION `dikembalikan_ke` (`p_id_spesialisasi` INT(11), `p_tahun` INT(6), `p_jns_instansi` VARCHAR(12)) RETURNS INT(4) BEGIN
    DECLARE v_hasil int(11) DEFAULT 0;

    IF LOWER(p_jns_instansi) = 'puskesmas' THEN
        SELECT COUNT(lp1.id) INTO v_hasil FROM dc_layanan_pendaftaran lp1 INNER JOIN dc_pendaftaran p1 ON p1.id=lp1.id_pendaftaran INNER JOIN dc_instansi i1 ON i1.id=p1.id_instansi_perujuk WHERE p1.id_instansi_perujuk=p1.id_instansi_merujuk AND lp1.id_unit_layanan=p_id_spesialisasi AND YEAR(p1.waktu_daftar)=p_tahun AND i1.nama LIKE '%puskesmas%';
    ELSEIF LOWER(p_jns_instansi) = 'rs' THEN
        SELECT COUNT(lp1.id) INTO v_hasil FROM dc_layanan_pendaftaran lp1 INNER JOIN dc_pendaftaran p1 ON p1.id=lp1.id_pendaftaran INNER JOIN dc_instansi i1 ON i1.id=p1.id_instansi_perujuk WHERE p1.id_instansi_perujuk=p1.id_instansi_merujuk AND lp1.id_unit_layanan=p_id_spesialisasi AND YEAR(p1.waktu_daftar)=p_tahun AND (i1.nama LIKE 'rs%' OR i1.nama LIKE '%rumah sakit%');
    ELSEIF LOWER(p_jns_instansi) = 'lainnya' THEN
        SELECT COUNT(lp1.id) INTO v_hasil FROM dc_layanan_pendaftaran lp1 INNER JOIN dc_pendaftaran p1 ON p1.id=lp1.id_pendaftaran INNER JOIN dc_instansi i1 ON i1.id=p1.id_instansi_perujuk WHERE p1.id_instansi_perujuk=p1.id_instansi_merujuk AND lp1.id_unit_layanan=p_id_spesialisasi AND YEAR(p1.waktu_daftar)=p_tahun AND i1.nama NOT LIKE '%puskesmas%' AND i1.nama NOT LIKE 'rs%' AND i1.nama NOT LIKE '%rumah sakit%';
    END IF;

    RETURN v_hasil;
END$$

