CREATE DEFINER=`root`@`localhost` FUNCTION `genNoLab` () RETURNS VARCHAR(10) CHARSET latin1 NO SQL
BEGIN
  DECLARE num int(5);
DECLARE nolab varchar(5);
DECLARE fmt varchar(10);
set num = 0;
set nolab = '';
set fmt = concat_ws('', DATE_FORMAT(CURDATE(), '%y'), DATE_FORMAT(CURDATE(), '%m'), DATE_FORMAT(CURDATE(), '%d'));
select count(*) into num from dc_laboratorium where kode like CONCAT( fmt, '%'); 

select if(num > 0, LPAD(num+1, 4, 0), '0001') into nolab;
return concat_ws('', fmt, nolab);
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `genReg` (`tgl_daftar` DATE) RETURNS VARCHAR(10) CHARSET latin1 NO SQL
BEGIN
DECLARE reg VARCHAR(10);
DECLARE last_no INT(4) DEFAULT NULL;
SET reg = '';
select if(count(*) = 0, 0, CONVERT(SUBSTRING(max(no_register), 7), SIGNED INTEGER)) into last_no
from dc_pendaftaran where date(waktu_daftar) = tgl_daftar;

select concat_ws('', DATE_FORMAT(tgl_daftar, '%y'), DATE_FORMAT(tgl_daftar, '%m'), DATE_FORMAT(tgl_daftar, '%d'), LPAD(last_no+1, 4, 0)) into reg;

RETURN reg;
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `get_akomodasi` (`id_pendaftaran` INT(11)) RETURNS DOUBLE NO SQL
BEGIN
  DECLARE total_ranap DOUBLE;  
  DECLARE total_kamar_op DOUBLE;  
  DECLARE total_adm DOUBLE;  

  SET total_ranap = 0;
  SET total_kamar_op = 0;
  SET total_adm = 0;

  SELECT IFNULL(SUM(ri.total_hari * ri.nominal), 0) INTO total_ranap
  FROM dc_rawat_inap ri 
  JOIN dc_layanan_pendaftaran lp ON (lp.id = ri.id_layanan_pendaftaran) 
  JOIN dc_kelas kl ON (ri.id_kelas = kl.id) 
  WHERE lp.id_pendaftaran = id_pendaftaran 
  AND kl.nama NOT IN ('ICU', 'NICU');

 select IFNULL(sum(jml), 0) INTO total_kamar_op from (
  select IFNULL(sum(jko.harga_kamar),0) as jml  
  from dc_jadwal_kamar_operasi jko
  join dc_kamar_operasi kmo on (jko.id_kamar_operasi = kmo.id) 
  JOIN dc_layanan_pendaftaran lp ON (lp.id = jko.id_layanan_pendaftaran) 
  where lp.id_pendaftaran = id_pendaftaran 
  group by jko.no_registrasi
  having sum(jko.harga_kamar) is not NULL
) as q;
  
  
  SELECT IFNULL(SUM(tk.total * tk.qty), 0) INTO total_adm
  FROM dc_tarif_tindakan tk  
  JOIN dc_komponen_tarif kt ON (kt.id = tk.id_komponen_tarif) 
  JOIN dc_layanan_pendaftaran lp ON (lp.id = tk.id_layanan_pendaftaran) 
  WHERE lp.id_pendaftaran = id_pendaftaran 
  AND kt.id_layanan in (SELECT layanan_id FROM conf_billcbg WHERE item = 'adm');
  
  RETURN (total_ranap + total_adm + total_kamar_op);
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `get_alkes` (`id_pendaftaran` INT(11)) RETURNS DOUBLE NO SQL
BEGIN
  DECLARE total_obat DOUBLE; 
  DECLARE total_bhp DOUBLE;
  DECLARE total_bhp_operasi DOUBLE;
  DECLARE qty INT(11);  
  
  SET total_obat = 0;
  SET total_bhp = 0;
  SET total_bhp_operasi = 0;
  SET qty = 0;

  SELECT  pjd.qty, SUM((pjd.harga_jual - pjd.disc_rp ) * pjd.qty) INTO qty, total_obat 
  FROM dc_detail_penjualan pjd 
  JOIN dc_penjualan p ON (pjd.id_penjualan = p.id) 
  JOIN dc_kemasan_barang kb ON (kb.id = pjd.id_kemasan) 
  JOIN dc_barang bg ON (bg.id = kb.id_barang) 
  JOIN dc_layanan_pendaftaran lp ON (lp.id = p.id_layanan_pendaftaran)
  WHERE bg.id_kategori = '100' 
  AND p.id_resep IS NOT NULL 
  AND lp.id_pendaftaran = id_pendaftaran
  AND p.id_kemoterapi IS NULL 
  HAVING pjd.qty > 0;
  
  
   SELECT  pjd.qty, SUM((pjd.harga_jual - pjd.disc_rp ) * pjd.qty) INTO qty, total_bhp 
  FROM dc_detail_penjualan pjd 
  JOIN dc_penjualan p ON (pjd.id_penjualan = p.id) 
  JOIN dc_kemasan_barang kb ON (kb.id = pjd.id_kemasan) 
  JOIN dc_barang bg ON (bg.id = kb.id_barang) 
  JOIN dc_layanan_pendaftaran lp ON (lp.id = p.id_layanan_pendaftaran)
