  AND p.id_resep IS NULL 
  AND lp.id_pendaftaran = id_pendaftaran
  AND p.id_kemoterapi IS NULL 
  HAVING pjd.qty > 0;
  
  
  SELECT IFNULL(SUM((pjd.harga_jual - pjd.disc_rp) * pjd.qty), 0) INTO total_bhp_operasi  
