CREATE DEFINER=`root`@`localhost` FUNCTION `jumlah_kunjungan` (`p_id_pendaftaran` INT(11)) RETURNS INT(4) BEGIN
DECLARE v_id_pasien varchar(24);
DECLARE v_waktu_max timestamp;
DECLARE v_waktu_min timestamp;
DECLARE v_jenis varchar(24);
DECLARE v_hasil int(4);

SELECT id_pasien, waktu_daftar, TIMESTAMP(DATE_ADD(DATE(waktu_daftar), INTERVAL - WEEKDAY(DATE(waktu_daftar)) DAY)), jenis INTO v_id_pasien, v_waktu_max, v_waktu_min, v_jenis FROM dc_pendaftaran WHERE id=p_id_pendaftaran;

SELECT COUNT(id) INTO v_hasil FROM dc_pendaftaran WHERE id_pasien=v_id_pasien AND jenis=v_jenis AND waktu_daftar BETWEEN v_waktu_min AND v_waktu_max;

RETURN v_hasil;
END$$

CREATE DEFINER=`remote`@`%` FUNCTION `next_antrian` (`tanggal` DATE, `poliklinik` INT(11), `dokter` INT(6) UNSIGNED ZEROFILL, `jadwal_dokter` INT(6)) RETURNS INT(5) BEGIN

DECLARE next_antri int(5);

IF jadwal_dokter > 0 THEN
	SELECT (IFNULL(MAX(no_antri), 0) + 1) INTO next_antri FROM `dc_layanan_pendaftaran` WHERE 1 
	AND DATE(`waktu`) = DATE(`tanggal`) 
	AND `id_unit_layanan` = poliklinik 
	AND `id_dokter` = dokter
	AND `reset_antrian` = '0' 
	AND `id_jadwal_dokter` = jadwal_dokter;
ELSE
	SELECT (IFNULL(MAX(no_antri), 0) + 1) INTO next_antri FROM `dc_layanan_pendaftaran` WHERE 1 
	AND DATE(`waktu`) = DATE(`tanggal`) 
	AND `id_unit_layanan` = poliklinik 
	AND `id_dokter` = dokter
	AND `reset_antrian` = '0';
END IF;

RETURN next_antri;

END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `rehab_medik_total` (`p_id_layanan` INT(11), `p_tahun` INT(6)) RETURNS INT(4) BEGIN
    DECLARE v_hasil int(11) DEFAULT 0;
    DECLARE v_kode varchar(30);

    SELECT kode INTO v_kode FROM dc_layanan WHERE id=p_id_layanan;
    
    IF p_tahun IS NOT NULL THEN
        SELECT COUNT(df.id) INTO v_hasil FROM dc_detail_fisioterapi df INNER JOIN dc_fisioterapi f ON f.id=df.id_fisioterapi INNER JOIN dc_komponen_tarif kt ON kt.id=df.id_tarif INNER JOIN dc_layanan l ON l.id=kt.id_layanan WHERE YEAR(f.waktu_konfirm)=p_tahun AND l.id_jenis_pemeriksaan='15' AND (l.kode=v_kode OR l.kode LIKE CONCAT(v_kode, '.%'));
    ELSE
        SELECT COUNT(df.id) INTO v_hasil FROM dc_detail_fisioterapi df INNER JOIN dc_fisioterapi f ON f.id=df.id_fisioterapi INNER JOIN dc_komponen_tarif kt ON kt.id=df.id_tarif INNER JOIN dc_layanan l ON l.id=kt.id_layanan WHERE l.id_jenis_pemeriksaan='15' AND (l.kode=v_kode OR l.kode LIKE CONCAT(v_kode, '.%'));
    END IF;

    RETURN v_hasil;
END$$

